import React from 'react';
import Tilt from 'react-tilt';
import brain from './brain.png'
import './Logo.css';
const Logo = () => {
    return (
        <Tilt className='Tilt'options={{ max: 50 }} 
         >
        <div className='logo'>
            <Tilt className="Tilt" 
                options={{ max: 25 }} 
                style={{ height: 150, width: 150 }} >
                <div className="Tilt-inner ma2"> 
                   <img  src={brain}/>
                </div>
            </Tilt>
        </div>
        </Tilt>
    );
}

export default Logo;
